(function () {
  var shared = {
    ID: "OPT-ZTSPZ-445",
    VARIATION: "1",
    CLIENT: "zoom",
  };

  var ID = shared.ID,
    VARIATION = shared.VARIATION;

  var EVENT_PREFIX = ID.concat('__');

  function optlyTrack(eventName) {
    window['optimizely'].push({
      type: 'event',
      eventName: EVENT_PREFIX + eventName
    });
  }

  function isHomePage() {
    var pathname = window.location.pathname;
    if (pathname === '/') {
      return true;
    } else {
      if (pathname.length === 3 || pathname.length === 6) {
        var reg = new RegExp(pathname.replace('/', ''), 'i');
        return reg.test(ZmOptlyUtil.getCookie('_zm_lang'));
      }
    }

    return false;
  }

  document.addEventListener('click', function (evt) {
    if (!evt.target) {
      return;
    }

    if (!!evt.target.closest('.billing-shopping-bag__container-badge')) {
      // [Click][PersistentCart] Persistent Cart Icon
      optlyTrack('persistent__click-cart-icon');
      if (isHomePage()) {
        // [Click][PersistentCart] Home Cart Icon
        optlyTrack('home__click-cart-icon');
      }
    }
  }, true);
})();
