    waitUntil(function() {
        return document.querySelector('.tabs-new') !== null;
    }, function() {
        tabContentUpdate();
        insertBordersBetweenTabs();
    });
    
    waitUntil(function() {
        return document.querySelector('.basic-plan-card') !== null;
    }, function() {
        planContentUpdate();
    });
