    /**
     * Waits until a given condition is true or times out after 10 seconds.
     * Executes a success callback if the predicate becomes true,
     * or an error callback if it times out.
     */
    function waitUntil(predicate, success, error) {
        var int = setInterval(function() {
            if (predicate()) {
                clearInterval(int);
                int = null;
                success();
            }
        }, 33);
        setTimeout(function() {
            if (int !== null) {
                clearInterval(int);
                if (typeof error === 'function') {
                    error();
                }
            }
        }, 10000);
    }
    
		function insertBordersBetweenTabs() {
		  let tabItems = document.querySelectorAll('.zm-tabs__nav[role="tablist"] .zm-tabs__item');
		
		  if (tabItems.length === 0) {
		    tabItems = document.querySelectorAll('.tab-scroll');
		  }
		
		  if (tabItems.length === 0) {
		    // No tab elements found, so exit early
		    return;
		  }
		
		  tabItems.forEach((item, index) => {
		    if (index < tabItems.length - 1) {
		      const borderDiv = document.createElement('div');
		      borderDiv.className = 'border_tab';
		      item.parentNode.insertBefore(borderDiv, item.nextSibling);
		    }
		  });
		}
    
